import React from "react";
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import Navbar from "./components/Navbar";
import Home from "./pages/Home";
import Login from "./pages/Login";
import Register from "./pages/Register";
import RecyclingCenters from "./pages/RecyclingCenters";
import RecyclingRequests from "./pages/RecyclingRequests";
import Profile from "./pages/Profile";
import PrivateRoute from "./components/PrivateRoute";
import { AuthProvider } from "./context/AuthContext";

const App = () => {
  return (
    <AuthProvider>
      <Router>
        <Navbar />
        <Routes>
          <Route path="/" element={<Home />} />
          <Route path="/login" element={<Login />} />
          <Route path="/register" element={<Register />} />
          <Route path="/recycling-centers" element={<RecyclingCenters />} />
          <Route path="/recycling-requests" element={<PrivateRoute component={RecyclingRequests} />} />
          <Route path="/profile" element={<PrivateRoute component={Profile} />} />
        </Routes>
      </Router>
    </AuthProvider>
  );
};

export default App;
